import React, { Component } from 'react'

class Navbar extends Component {
  render () {
    return (
      <header class="mdl-layout__header">
        <div class="mdl-layout__header-row">
          <span class="mdl-layout-title">Monitor</span>
        </div>
      </header>
    )
  }
}

export default Navbar
